import React from "react";
import {Routes, Route} from 'react-router-dom';
import Home from './Component/Home';
import About from './Component/About';
import Couture from './Component/Couture';
import Store from './Component/Store';
import Contact from './Component/Contact';
import Error from './Component/Error';
import Footer from "./Component/Footer";
import Logo from "../"
import {Nav, NavLink, Bars, NavMenu, NavBtn, NavBtnLink} from './Component/NavbarElements';
import BookAppointment from "./Component/BookAppointment";
import ScrollToTop from "./Component/ScrollToTop";
// import TransparentHeader from "./Component/TransparentHeader";


const App=()=>{
  return(
    <>
    <ScrollToTop/>
    <Nav>
        <NavLink to="/">
        <img src={Logo} alt="aivys-logo" />
        </NavLink>
        <Bars />
        <NavMenu>
          <NavLink to="/about" activeStyle>
            About
          </NavLink>
          <NavLink to="/couture" activeStyle>
          Couture Process
          </NavLink>
          <NavLink to="/store" activeStyle>
            Store
          </NavLink>
         <NavLink to="/contact" activeStyle>
            Contact
          </NavLink>
        </NavMenu>
        <NavBtn>
          <NavBtnLink to="/bookappointment">
            Book Appointment
          </NavBtnLink>
        </NavBtn>
      </Nav>


      <Footer/>
    </>
  )
}
export default App;
